import { RouterProvider, createBrowserRouter } from "react-router-dom";

import "./App.css";

import CollectionDetailPage, {loader as collectionDetailLoader} from "./pages/CollectionDetail";
import CollectionPage from "./pages/Collections";
import HomePage from "./pages/HomePage";
import RootLayout from "./pages/Root";

function App() {
	const router = createBrowserRouter([
		{
			path: "/",
			element: <RootLayout />,
			children: [
				{
					path: "/",
					element: <HomePage />,
				},
				{
					path: "/collections",
					element: <CollectionPage />, loader: async () => {
						const response = await fetch('http://localhost:8080/collections');

						if (!response.ok) {
						} else {
						  const resData = await response.json();
						  return resData.collections
						}
					}
				},
				{
					path: "/collections:collectionId",
					element: <CollectionDetailPage />,
					loader: collectionDetailLoader,
				},
			],
		},
	]);
	return <main className="main"> <RouterProvider router={router}/></main>;
}

export default App;
